import React from 'react';

function Text() {
    return (
        // <p>Grapic and web design are far more than a job</p>
        <div>
            <form>

                <input type="checkbox" name="name" />
                <br></br>
                <input type="submit" value="Submit" />
            </form>
        </div>
    );
}

export default Text;
